qDef.qDef:
if(
ValueList('Actual','Previous','Budget')='Previous'
	,$(v_Sales_Contribution_Amount_LY_YTD)
	,if
    (
    	ValueList('Actual','Previous','Budget')='Actual'
		,$(v_Sales_Contribution_Amount_YTD)
		,$(v_Budget_Contribution_Amount_YTD)
	)
)/1000

qAttributeExpressions.qExpression:
if(
	Sum({$<[Sales Type] = {'Net Sales'},$(v_B2C_Sales_Filter),$(v_Neutralize_Filter), [Month ID] = {"<=$(v_Max_Month_ID)"}, Year = {$(v_Max_Year)}, Quarter=, Month=, [Month Year]=>} [Invoice MT])>=0
	,rgb(0,0176,80)
    ,rgb(255,0,0)
  )

if(
	Sum({$<[Sales Type] = {'Net Sales'},$(v_B2C_Sales_Filter),$(v_Neutralize_Filter), [Currency Sorting Key]={$(=MaxString([Currency Sorting Key]))}, [Month ID] = {"<=$(v_Max_Month_ID)"}, Year = {$(v_Max_Year)} , Quarter=, Month=, [Month Year]=>} [Invoice Amount USD]*[Currency Average Rate])>=0
    ,rgb(0,0,0)
    ,rgb(255,0,0)
  )

if(
	Sum({$<[Sales Type] = {'Net Sales'},$(v_B2C_Sales_Filter),$(v_Neutralize_Filter), [Currency Sorting Key]={$(=MaxString([Currency Sorting Key]))}, [Month ID] = {"<=$(v_Max_Month_ID)"}, Year = {$(v_Max_Year)}, Quarter=, Month=, [Month Year]=>} [Invoice Amount USD]*[Currency Average Rate])
    >=0
    ,rgb(128,128,128)
    ,rgb(255,0,0)
  )

if(
	Pick(
	$(v_Switch_Option_LY_BUD)
    ,sum({$<[Sales Type] = {'Net Sales'},$(v_B2C_Sales_Filter),$(v_Neutralize_Filter), [Month ID] = {"<=$(v_Max_Month_ID_LY)"}, Year = {$(v_Max_Year_LY)} , Quarter=, Month=, [Month Year]=>} [Invoice MT])
	,Sum({$<[Sales Type] = {'Budget'},$(v_B2C_Sales_Filter),$(v_Neutralize_Filter), [Month ID] = {"<=$(v_Max_Month_ID)"}, Year = {$(v_Max_Year)} , Quarter=, Month=, [Month Year]=>} [Budget MT])
    )>=0
    ,rgb(0,176,80)
    ,rgb(255,0,0)
  )

if(
	Pick(
	$(v_Switch_Option_LY_BUD)
    ,Sum({$<[Sales Type] = {'Net Sales'},$(v_B2C_Sales_Filter),$(v_Neutralize_Filter), [Currency Sorting Key]={$(=MaxString([Currency Sorting Key]))},[Month ID] = {"<=$(v_Max_Month_ID_LY)"}, Year = {$(v_Max_Year_LY)} , Quarter=, Month=, [Month Year]=>} [Invoice Amount USD]*[Currency Average Rate])
	,Sum({$<[Sales Type] = {'Budget'},$(v_B2C_Sales_Filter),$(v_Neutralize_Filter), [Month ID] = {"<=$(v_Max_Month_ID)"}, Year = {$(v_Max_Year)} , Quarter=, Month=, [Month Year]=>} [Budget Amount USD]*[Currency Average Rate])
    )
	>=0
    ,rgb(128,128,128)
    ,rgb(255,0,0)
  )
